    <script>
        //Information arrays
        const Clusterinformation =
            [
                ["Job name", "Overview", "Highschool Classes", "Majors that foucus on this", "Related jobs", 'https://www.google.com/search?q=agriculture&sca_esv=9efc2208284496d4&sca_upv=1&source=hp&ei=oFTzZY_iKv-L0PEPhJm4GA&iflsig=ANes7DEAAAAAZfNisMqaYFCkEwbzGl4XrEaGsFpk6CJQ&ved=0ahUKEwiPssTwwvSEAxX_BTQIHYQMDgMQ4dUDCA0&uact=5&oq=agriculture&gs_lp=Egdnd3Mtd2l6IgthZ3JpY3VsdHVyZTIFEAAYgAQyBRAAGIAEMgUQABiABDIFEAAYgAQyBRAAGIAEMgUQABiABDIFEAAYgAQyBRAuGIAEMgUQABiABDIFEAAYgARIzzlQ6R9YxDdwAngAkAEAmAFNoAGgBaoBAjExuAEDyAEA-AEBmAILoALRBagCAMICCxAuGIAEGMcBGNEDmAMCkgcCMTGgB6RM&sclient=gws-wiz'],
                [],
                []
            ];
        let zoomscale=1;
        //stores the resolutions of the background_imported image of all the screen
        let Resolutions = [[4096*zoomscale, 2272]];

        //stores the screen the user is in
        let Screen = 0;

        //pauses the movement with a *-1 toggle
        var Movement = -1;

        //access root element in css
        var root = document.documentElement;

        // this is used to make sure that the image will load is the mouse is not in the viewport
        let MousePositionX = 0;
        let MousePositionY = 0;

        function CloseSidePanel_imported() {
            OpenSidePanel_imported(0, Screen);
        }

        //Function for side panel        
        function OpenSidePanel_imported(x, Path) {
            Movement = Movement * -1;
            MouseTrack(null);
            console.log(Path);
            document.querySelector('#InformationSidePanle_imported').classList.toggle('hidden_imported');
            document.querySelector('#InformationSidePanle_imported').classList.toggle('SlideIn_imported');
            document.querySelector('#Screens_imported').classList.toggle('zoomin');
            document.querySelector('#MainHeading_imported').textContent = (Clusterinformation[Path][0]);
            document.querySelector('#OverviewText_imported').textContent = (Clusterinformation[Path][1]);
            document.querySelector('#HSClassesRelatedText_imported').textContent = (Clusterinformation[Path][2]);
            document.querySelector('#MajorsFoucus_imported').textContent = (Clusterinformation[Path][3]);
            document.querySelector('#RelatedJobsText_imported').textContent = (Clusterinformation[Path][4]);
            document.querySelector('#hyperlink_imported').setAttribute('href', Clusterinformation[Path][5]);
        }
        
        // function for tracking the mouse movement
        function zoom(adder){
            zoomscale+=adder;
            Resolutions = [[4096*zoomscale, 2272*zoomscale]];
            root.style.setProperty('--zoomscale',zoomscale );
        }

        function MouseTrack(e) {

            if (e != null) {
                MousePositionX = e.clientX;
                MousePositionY = e.clientY;
            }

            let ZoomMultiplyer=1;
            //resolution of the window
            let vw = Math.max(document.documentElement.clientWidth || 0, window.innerWidth || 0);
            let vh = Math.max(document.documentElement.clientHeight || 0, window.innerHeight || 0);

            // multiplier used to fix zooming too far out and showing white space
            while (vh >= Resolutions[Screen][1] * ZoomMultiplyer || vw >= Resolutions[Screen][0] * ZoomMultiplyer) {
                ZoomMultiplyer = ZoomMultiplyer * 1.007;
                ZoomMultiplyer = ZoomMultiplyer * 1.007;
            }

            //converts the resolution of the background_imported to be certain vw/vh based on the image resolution
            root.style.setProperty('--background_importedWidth', Resolutions[Screen][0] * ZoomMultiplyer / vw * 101 + "vw");
            root.style.setProperty('--background_importedHigth', Resolutions[Screen][1] * ZoomMultiplyer / vh * 101 + "vh");
            if (-1 == Movement) {

                //finds what % of the screen thew muse is in and then convert it to a position relative to the background_imported vh/vw
                let ScreenPositionX = (MousePositionX / vw * (Resolutions[Screen][0] * ZoomMultiplyer / vw * 100 - 101)) + "vw";
                let ScreenPositionY = (MousePositionY / vh * (Resolutions[Screen][1] * ZoomMultiplyer / vh * 100 - 101)) + "vh";
                root.style.setProperty('--background_importedLeft', ScreenPositionX);
                root.style.setProperty('--background_importedTop', ScreenPositionY);
            }
        }

        //creates a tracking plane for the mouse
        document.querySelector('#Screens_imported').addEventListener('mousemove', MouseTrack);

        //makes the screen start at 0,0 if refreshed
        MouseTrack(null);
    </script>
